pragma solidity ^0.8.0;

contract Voting {
    struct Candidate {
        string name;
        uint256 voteCount;
    }

    address public owner;
    Candidate[] public candidates;
    bool public votingOpen;

    event CandidateAdded(string candidateName);
    event VoteCast(uint256 candidateIndex);

    constructor() {
        owner = msg.sender;
        votingOpen = false;
    }

    modifier onlyOwner() {
        require(msg.sender == owner, "Only the owner can perform this action");
        _;
    }

    function addCandidate(string memory candidateName) public onlyOwner {
        require(!votingOpen, "Cannot add candidates after voting has started");
        candidates.push(Candidate({
            name: candidateName,
            voteCount: 0
        }));
        emit CandidateAdded(candidateName);
    }

    function startVoting() public onlyOwner {
        require(!votingOpen, "Voting has already started");
        require(candidates.length > 0, "No candidates have been added");
        votingOpen = true;
    }

    function vote(uint256 candidateIndex) public {
        require(votingOpen, "Voting is not open");
        require(candidateIndex < candidates.length, "Invalid candidate index");
        candidates[candidateIndex].voteCount += 1;
        emit VoteCast(candidateIndex);
    }

    function getCandidateCount() public view returns (uint256) {
        return candidates.length;
    }
}
